## I18n Violations in a Library Platform

### 1. Hardcoded Text in JavaScript

**Violation:**
```javascript
function displayBookDetails(book) {
  alert(`You have borrowed the book "${book.title}" by ${book.author}.`);
}
```

**Explanation:** The text within the alert is hardcoded in English. If the platform needs to support other languages, this code will not work as expected.

**Inconsistent File Structure Issue:** If the platform has a separate `i18n` folder containing language files (e.g., `en.json`, `es.json`), the hardcoded text doesn't align with this structure, making it difficult to maintain and update translations.

### 2. Using `toUpperCase()` and `toLowerCase()` for Case Conversion

**Violation:**
```javascript
function searchBooks(query) {
  const normalizedQuery = query.toLowerCase();
  // Perform search using normalizedQuery
}
```

**Explanation:** The use of `toLowerCase()` assumes that the search should be case-insensitive in all languages, which might not be the case (e.g., in Turkish, "i" and "I" are considered different characters).

